import React from 'react';
import "./App.css";
import Form from "./Form"
import TodoList from "./TodoList"



const App = () => {
    return (
        <div className="App">
            <div><h1>Todo App</h1></div>
            <TodoList/>
            <Form/>

        </div>
    )
}

export default App;
